import React, { useEffect } from "react";
import { Link } from "react-router-dom";
import * as ROUTES from "../constants/routes.js";

import "../stylesheets/login.css";
import FormInput from "../atomComponents/form-input.js";

export default function Login(){

    useEffect( () => {
        document.title = "Login - Birdy";
    }, []);

    return(
        <main className="login-main column gap20">
            <div className="login-form-container column gap20">
                <h1 className="birdy-logo-h1">Birdy</h1>
                <form className="login-form column" method="POST">
                    <FormInput 
                        className="login-form-input" 
                        type="email" 
                        placeholder="Email address" 
                        ariaLabel="Enter your email address"
                    />
                    <FormInput 
                        className="login-form-input" 
                        type="password" 
                        placeholder="Password" 
                        ariaLabel="Enter your password"
                    />
                    <input className="login-form-submit" type="submit" value="Log In"/>
                </form>
            </div>
            <div className="login-no-account">
                <p>
                    Don't have an account?&ensp;
                    <Link className="login-ref-signup" to={ROUTES.SIGN_UP}>
                        Sign up
                    </Link>
                </p>
            </div>
        </main>
    )
};
